import { createUseStyles } from "react-jss";

const Map = ({ setStateMap }) => {

    const styles = createUseStyles({
        mapBox: {
            position: "absolute"
        }
    });

    const classes = styles()

    return (
        <div className={classes.mapBox}>
            <iframe title="map" className="about-map-iframe" src="https://yandex.ru/map-widget/v1/-/CCUFyLSvGD" width="940"
                height="410">
            </iframe>
            <button className="btn-map-close" onClick={() => setStateMap(false)}></button>
        </div>
    )
}

export default Map
